import React from "react";

interface DataItem {
    id: string;
    app: string;
    action: string;
    trigger: string;
    status: string;
  }

  interface TableContainerProps {
    data: DataItem[];
  }

  const Table: React.FC<TableContainerProps> = ({ data }) => {
    return (
      <div>
        <h1>Table Container</h1>
        <table>
          <thead>
            <tr>
              <th>Application</th>
              <th>Action</th>
              <th>Trigger</th>
              <th>Status</th>
            </tr>
            <p>{data.report}</p>
          </thead>

        </table>
      </div>
    );
  };

export default Table;
